import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Item from "./Item"
import SearchBar from "./SearchBar";

class Cart extends React.Component {

    render() {
        return (
            <>
                <Header />
                <div className="container-fluid "
                    style={{
                        backgroundColor: "#efefef",
                        fontFamily: "-apple-system, BlinkMacSystemFont, Segoe UI, Roboto, Oxygen, Ubuntu, Cantarell, Fira Sans, Droid Sans, Helvetica Neue, sans-serif",
                        height: "calc(100vh - 80px)"
                    }}>
                    <div className="row justify-content-center" style={{ width: "100%", backgroundColor: "red" }}>
                        <SearchBar />
                    </div>

                    <div class="row justify-content-center" style={{ backgroundColor: "blue" }}>
                        <div className=" d-flex align-items-center">
                            <div class="col" style={{ maxWidth: "400px" }}>
                                <Item itemName="Galaxy S4" itemCategory="Mobitel" itemPrice="100$" src="" value="ADD TO CART" />
                            </div>
                        </div>
                    </div>
                </div>
                <Footer />
            </>
        );
    }
}

export default Cart;
